// components/ContactCard/ContactCard.js
import React from "react";
import './ContactCard.css';

const ContactCard = () => {
  return (
    <div className="contact-card mt-5 p-4">
      <h5 className="text-center">Website by <span className="name">Darshan Raval</span></h5>
      <p className="text-center">
        Reach out at: <a href="mailto:darshanraval@example.com" className="contact-email">darshanraval@example.com</a>
      </p>
    </div>
  );
};

export default ContactCard;
